<script>
  function addRow() {

    var Course = document.getElementById("Course");
    var Theory = document.getElementById("Theory");
    var Lab = document.getElementById("Lab");
    var Total = document.getElementById("Total");
    var table = document.getElementById("myTableData");
    var Maintable = document.getElementById("myMainTable");

    var rowCount = table.rows.length;
    var row = table.insertRow(rowCount);
    console.log(rowCount);

    row.insertCell(0).innerHTML = '<input type="button" value = "Delete" onClick="Javacsript:deleteRow(this)">';
    row.insertCell(1).innerHTML = 60;
    row.insertCell(2).innerHTML = 40;
    row.insertCell(3).innerHTML = 100;
    row.insertCell(4).innerHTML = Theory.value;

    row.insertCell(5).innerHTML = Lab.value;

    var totalMarks = Number(Theory.value) + Number(Lab.value)

    row.insertCell(6).innerHTML = totalMarks;

    var rowCount1 = Maintable.rows.length;
    var row2 = Maintable.insertRow(rowCount1);

    row2.insertCell(0).innerHTML = Course.value;
    row2.insertCell(1).innerHTML = 60;
    row2.insertCell(2).innerHTML = 40;
    row2.insertCell(3).innerHTML = 100;
    row2.insertCell(4).innerHTML = Theory.value;

    row2.insertCell(5).innerHTML = Lab.value;
    row2.insertCell(6).innerHTML = totalMarks;


  }

  function deleteRow(obj) {

    var index = obj.parentNode.parentNode.rowIndex;
    var table = document.getElementById("myTableData");
    table.deleteRow(index);

    var Maintable = document.getElementById("myMainTable");
    Maintable.deleteRow(index);

  }
</script>


