<script>
  function pdf() {
    <?php

    $name = $_POST["awardedTo"];
    ?>
    <?php
    echo "var jsvar ='$name';";
    ?>

    var element = document.getElementById("printable2");
    var opt = {
      margin: [15, 0, 15, 0],
      filename: `${jsvar}.pdf`,
      image: {
        type: "jpeg",
        quality: 1
      },
      html2canvas: {
        dpi: 192,
        scale: 4,
        letterRendering: true,
        useCORS: true,
      },
      jsPDF: {
        unit: "mm",
        format: "a4",
        orientation: "portrait"
      },
    };

    // New Promise-based usage:
    html2pdf().set(opt).from(element).save();
  }
</script>